import './Navbar.css';

import React from 'react'
import { Link } from 'react-router-dom';


export default function Navbar() {
  return (
    <div className="navbar">
      <ul className="list">
        <li>
            <Link to="/students">Students</Link>
        </li>
        <li>
            <p>Teachers</p>
        </li>
        <li>
            <p>About the project</p>
        </li>
      </ul>
    </div>
  );
}
